import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Frmmain = () => {
  const [userType, setUserType] = useState(null);
  const [credentials, setCredentials] = useState({ username: '', password: '' });
  const navigate = useNavigate();

  const handleLogin = () => {
    if (userType === 'Administrator') {
      if (credentials.username === 'Administrator' && credentials.password === '1020') {
        navigate('/Administrator');
      } else {
        alert("Invalid username or password");
      }
    } else if (userType === 'deliver') {
      navigate('/deliver');
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to Chick-Chak Deliveries</h1>
      {!userType && (
        <div>
          <button onClick={() => setUserType('Administrator')}>Administrator Login</button>
          <br />
          <button onClick={() => setUserType('deliver')}>Courier Login</button>
        </div>
      )}
